// src/pages/Home.jsx
import React, { useEffect } from "react";
import Header from "../components/Header";

export default function Home() {
  useEffect(() => {
    // Re-run AOS animations if using AOS (you can re-init here)
    // AOS.init();
  }, []);

  return (
    <>
      <Layout>

      <div className="pt-24 lg:pt-32">
        {/* Hero Section */}
        <section className="relative mx-auto max-w-[1142px] px-4">
          <div className="relative mx-auto pt-32 text-center md:pt-40 lg:max-w-[965px]">
            <h1 className="text-4xl font-extrabold text-purple-700 dark:text-white md:text-7xl">
              We are skilled in{" "}
              <span className="inline-block">digital marketing</span>
            </h1>
            <p className="mt-4 text-purple-600 dark:text-purple-300 md:text-22">
              “You've got a business, we've got brilliant minds. We impact your brand for you, hassle free.”
            </p>
            <a href="contact-us.html" className="btn inline-flex mt-6">
              Talk to sale
            </a>
          </div>
        </section>

        {/* Stats Section */}
        <section className="py-16 lg:pb-44 lg:pt-40 text-center">
          <div className="grid grid-cols-2 gap-10 md:grid-cols-4">
            {[
              { value: "4.8k", label: "Jobs completed" },
              { value: "15+", label: "Industry experience" },
              { value: "3.6k", label: "Global client" },
              { value: "130+", label: "Awards winning" },
            ].map((item, idx) => (
              <div key={idx} className="space-y-3 md:space-y-5">
                <h3 className="text-3xl font-extrabold text-purple-700 dark:text-white">
                  {item.value}
                </h3>
                <div>{item.label}</div>
              </div>
            ))}
          </div>
        </section>

        {/* Services Section */}
        <section className="py-16 lg:pb-28 lg:pt-36 bg-gray-50 dark:bg-transparent">
          <div className="text-center max-w-2xl mx-auto mb-12">
            <h2 className="text-2xl font-bold text-purple-700 dark:text-white">
              High impact services to improve your business
            </h2>
            <p className="text-lg text-gray-600 dark:text-purple-300">
              Our team has a successful track record of helping brands scale profitably.
            </p>
          </div>
          {/* Map or list services here */}
        </section>

        {/* Other sections like Process, Why Choose Us, Plans, etc. */}
      </div>
      </Layout>
    </>
  );
}
